import Home from "./pages/Home";
import './index.css';
import { Routes, Route, BrowserRouter } from "react-router-dom";
import {AuthProvider } from './contexts/AuthContext';

function App() {
  return (
    <AuthProvider>
    <BrowserRouter>
      <Routes>
        {/* Basic Routes */}
        <Route path="/" element={<Home />}/>
      </Routes>
    </BrowserRouter>
    </AuthProvider>
  );
}

export default App;
